import React, { useEffect } from 'react';
import api from './services/api';

function App() {
  useEffect(() => {
    api.get('/')
      .then((res) => console.log(res.data))
      .catch((err) => console.error(err));
  }, []);

  return <div>Welcome to the Merchant Site!</div>;
}

export default App;
